// import logo from './logo.svg';
import './App.css';

function GetPokemon(props){
  return <h1>Hello, {props.name}</h1>;
}


class App extends Component {
  getPokemon() {
    return 'Bukbi'
  }


  render() {
    return (
      <div>
        <h1>Hello, {getPokemon()}</h1>
      </div>

    )
  }
}


export default App;
